INSERT INTO `tb_noticia` VALUES (1,'Novo capim elefante produz mais que cana com a qualidade do milho','O potencial de produÃ§Ã£o da BRS CapiaÃ§u supera o do milho e da cana-de-aÃ§Ãºcar, atingindo mÃ©dia de 50 toneladas de matÃ©ria seca por hectare/ano.','<p>Desenvolvida pelo programa de melhoramento gen&eacute;tico de capim elefante da Embrapa Gado de Leite, a BRS Capia&ccedil;u tem caracter&iacute;sticas forrageiras superiores &agrave;s demais cultivares de capim elefante. Inova na forma de uso da forrageira, pois apresenta potencial para produzir silagem. Tamb&eacute;m pode ser oferecida aos bovinos leiteiros picada verde ou como componente de silagem com outros volumosos, como milho e sorgo.</p>\n\n<p>O potencial de produ&ccedil;&atilde;o da BRS Capia&ccedil;u supera o do milho e da cana-de-a&ccedil;&uacute;car, atingindo m&eacute;dia de 50 toneladas de mat&eacute;ria seca por hectare/ano, com menor custo. Sua silagem tem teor de prote&iacute;na bruta equivalente ao da silagem de milho e superior o da silagem de cana. Al&eacute;m disso, tem boa toler&acirc;ncia ao estresse h&iacute;drico, o que o torna alternativa ao milho em regi&otilde;es com alto risco de veranico.</p>\n\n<p>A BRS Capia&ccedil;u &eacute; cultivada por meio de colmos, com propaga&ccedil;&atilde;o vegetativa. Essa variedade de capim abre um leque de oportunidades. O produtor poder&aacute; produzir mais que a cana com a qualidade da silagem do milho.</p>\n\n<p>Mais informa&ccedil;&otilde;es:</p>\n\nCarolina Rodrigues Pereira Embrapa Gado de Leite\n\n<ul>\n	<li>gado-de-leite.imprensa@embrapa.br</li>\n	<li>Telefone: (32) 3311-7548</li>\n</ul>\n','_26_01_16_04_59_20_noticias.jpg','2016-01-27 00:20:38',9,1,107,1),(2,'Investimentos do Governo Federal em AcreÃºna no ano de 2015','Governo federal investe menos de R$ 30,00 por habitante em AcreÃºna no ano de 2015','<p>Chama-se conv&ecirc;nio quando o munic&iacute;pio deve dar uma contra-partida de um investimento federal. E esses conv&ecirc;nios em pequenas cidades s&atilde;o fundamentais para a obten&ccedil;&atilde;o da infra-estrutura, que custa caro. O ano de 2015 n&atilde;o foi dos melhores para a economia nacional e os conv&ecirc;nios entre munic&iacute;pio e governo federal sofreram severamente esse impacto.</p>\r\n\r\n<p>No site da Transpar&ecirc;ncia Brasil, onde o governo federal divulga os seus investimentos, pudemos encontrar somente quatro obras em Acre&uacute;na:</p>\r\n\r\n<p>Pelos dados do governo, apenas R$ 606.600,00 foram investidos aqui. &Eacute; muito pouco para uma cidade carente de todo tipo de infraestrutura, desde saneamento b&aacute;sico e redes pluviais a hospitais e escolas. Abaixo segue algumas compara&ccedil;&otilde;es sobre esses valores:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\r\n	<thead>\r\n		<tr>\r\n			<th scope=\"col\">Descri&ccedil;&atilde;o</th>\r\n			<th scope=\"col\">Valor Total</th>\r\n			<th scope=\"col\">Data Libera&ccedil;&atilde;o</th>\r\n			<th scope=\"col\">Liberado R$</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>Recapeamento asf&aacute;ltico</td>\r\n			<td>394.200,00</td>\r\n			<td>13/11/2015</td>\r\n			<td>197.100,00</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Aquisi&ccedil;&atilde;o de patrulha mecanizada</td>\r\n			<td>175.500,00</td>\r\n			<td>12/11/2015</td>\r\n			<td>175.500,00</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Reforma de quadras</td>\r\n			<td>390.000,00</td>\r\n			<td>28/09/2015</td>\r\n			<td>195.000,00</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Constru&ccedil;&atilde;o de quadra esportiva coberta</td>\r\n			<td>195.000,00</td>\r\n			<td>15/01/2015</td>\r\n			<td>39.000,00</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Em 2014 foram investidos R$ 1.704.960,60. Uma diminui&ccedil;&atilde;o de 65% esse ano;</li>\r\n	<li>Com a previs&atilde;o de 21.730 habitantes para 2015, segundo o IBGE, isso d&aacute; R$ 27,90 de investimento por habitante aqui. Isso mesmo, o governo federal investiu menos de R$ 30,00 no seu munic&iacute;pio.</li>\r\n	<li>Em Santa Helena de Goi&aacute;s, essa m&eacute;dia foi de R$ 12,25.</li>\r\n	<li>Rio Verde contou com R$ 13,15.</li>\r\n</ul>\r\n\r\n<p>Sobre o como o dinheiro foi investido aqui, novas publica&ccedil;&otilde;es no seu portal falar&aacute; sobre cada uma delas.</p>\r\n','_27_01_16_11_52_05_noticias.jpg','2016-01-27 13:52:05',3,1,90,1),(3,'Pesquisador cria irrigador solar automÃ¡tico com garrafas usadas','Um irrigador automÃ¡tico que nÃ£o usa eletricidade e ainda pode ser feito com materiais usados. Essa criaÃ§Ã£o rÃºstica e eficaz de um pesquisador da Embrapa poderÃ¡ ajudar de pequenos produtores a jardineiros amadores a manter seus canteiros irrigados automaticamente pelo mÃ©todo de gotejamento.','<p>Um irrigador autom&aacute;tico que n&atilde;o usa eletricidade e ainda pode ser feito com materiais usados. Essa cria&ccedil;&atilde;o r&uacute;stica e eficaz de um pesquisador da Embrapa poder&aacute; ajudar de pequenos produtores a jardineiros amadores a manter seus canteiros irrigados automaticamente pelo m&eacute;todo de gotejamento.<br />\r\n<br />\r\nDesenvolvido pelo f&iacute;sico Washington Luiz de Barros Melo, pesquisador da Embrapa Instrumenta&ccedil;&atilde;o (SP), o equipamento &eacute; baseado em um princ&iacute;pio simples da termodin&acirc;mica: o ar se expande quando aquecido. Melo se valeu dessa propriedade para utilizar o ar como uma bomba que pressiona a &aacute;gua para a irriga&ccedil;&atilde;o.<br />\r\n<br />\r\nUma garrafa de material r&iacute;gido pintada de preto &eacute; emborcada sobre outra garrafa que cont&eacute;m &aacute;gua. Quando o sol incide sobre a garrafa escura, o calor aquece o ar em seu interior que, ao se expandir, empurra a &aacute;gua do recipiente de baixo e a expulsa por uma mangueira fina para gotejar na planta&ccedil;&atilde;o.<br />\r\n<br />\r\n&quot;Funciona t&atilde;o bem que se voc&ecirc; sombrear a garrafa, o gotejamento para, e, ao deixar o sol bater novamente, a &aacute;gua volta a gotejar&quot;, afirma o pesquisador que apresenta sua inven&ccedil;&atilde;o na 67&ordf; Reuni&atilde;o da Sociedade Brasileira para o Progresso da Ci&ecirc;ncia (SBPC), de 12 a 18 de julho na Universidade Federal de S&atilde;o Carlos (UFSCar), S&atilde;o Paulo.<br />\r\n<br />\r\nFazem parte do invento outros dois dep&oacute;sitos de &aacute;gua: uma garrafa r&iacute;gida tamb&eacute;m emborcada que desempenha a fun&ccedil;&atilde;o de caixa d&#39;&aacute;gua para manter abastecida a garrafa do gotejamento, e um recipiente maior conectado &agrave; garrafa-caixa-d&#39;&aacute;gua que armazena um volume maior de &aacute;gua que ser&aacute; usado por todo o sistema (veja esquema abaixo).<br />\r\n<br />\r\n&quot;Os tubos que interligam as garrafas podem ser de equipos de soro hospitalar, por exemplo, mas j&aacute; utilizei at&eacute; capas de fios el&eacute;tricos, retirei os fios de cobre de dentro e funcionou tamb&eacute;m,&quot; conta o pesquisador.<br />\r\n<br />\r\nEle explica que o maior desafio para quem for fazer o equipamento em casa &eacute; a veda&ccedil;&atilde;o. Para o funcionamento do sistema &eacute; necess&aacute;rio que as tr&ecirc;s primeiras garrafas estejam fechadas hermeticamente. &quot;Isso pode ser obtido com adesivos pl&aacute;sticos, do tipo Araldite, mas exige uma aplica&ccedil;&atilde;o minuciosa&quot;, ensina.<br />\r\n<br />\r\nTamb&eacute;m comp&otilde;e o sistema um distribuidor que pode ser constru&iacute;do com garrafa pet e do qual saem as tubula&ccedil;&otilde;es que far&atilde;o a irriga&ccedil;&atilde;o.<br />\r\n<br />\r\n<strong>Econ&ocirc;mico e ecol&oacute;gico</strong><br />\r\n<br />\r\nAs vantagens do irrigador caseiro s&atilde;o v&aacute;rias, conforme enumera Melo. Trata-se de um sistema autom&aacute;tico sem fotoc&eacute;lulas e que n&atilde;o demanda eletricidade, pois depende somente da luz solar, tornando sua opera&ccedil;&atilde;o extremamente econ&ocirc;mica. Ele promove igualmente uma economia de &aacute;gua, pois utiliza o m&eacute;todo de gotejamento para irrigar, o que evita o desperd&iacute;cio do recurso.<br />\r\n<br />\r\n&quot;Al&eacute;m disso, &eacute; poss&iacute;vel constru&iacute;-lo com objetos que seriam jogados no lixo, como garrafas e recipientes de pl&aacute;stico, metal ou vidro&quot;, lembra o especialista.<br />\r\n<br />\r\nA versatilidade do equipamento tamb&eacute;m &eacute; grande. A intensidade do gotejamento pode ser regulada por meio da altura do gotejador e o produtor pode colocar nutrientes ou outros insumos na &aacute;gua do reservat&oacute;rio para otimizar a irriga&ccedil;&atilde;o.</p>\r\n\r\n<p>Mais informa&ccedil;&otilde;es:</p>\r\n\r\n<p>Joana Silva (MTb 19.554/SP)<br />\r\nEmbrapa Instrumenta&ccedil;&atilde;o<br />\r\ninstrumenta&ccedil;&atilde;o.imprensa@embrapa.br<br />\r\nPhone number: (16) 2107-2901</p>\r\n','_27_01_16_07_34_22_noticia.jpeg','2016-01-27 21:34:22',9,1,43,1),(4,'Dicas de como decorar e ampliar ambientes com espelhos','Truques simples utilizando espelhos prometem deixar ambientes mais iluminados e com sensaÃ§Ã£o de maior amplitude','<p>&nbsp;</p>\r\n\r\n<p>Um dos poucos acess&oacute;rios un&acirc;nimes da arquitetura &eacute;, sem sombra de d&uacute;vidas, o espelho. Al&eacute;m de se harmonizar com todos os estilos de decora&ccedil;&atilde;o, cores e texturas, o espelho tamb&eacute;m se adapta facilmente em ambientes de todos os tamanhos. Deixando de exercer apenas seu papel funcional, sendo usado unicamente em paredes de quartos e banheiros, hoje se tornou um excelente aliado na decora&ccedil;&atilde;o de interiores.&nbsp;Atualmente, &eacute; habitual us&aacute;-lo para cobrir uma parede, uma vez que transmite a impress&atilde;o de amplitude ao ambiente. Funciona principalmente para c&ocirc;modos pequenos. O segredo est&aacute; na forma como &eacute; utilizado e o seu tamanho.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://portalacreuna.com.br/admin/imagens/anna/1.jpg\" style=\"height:490px; width:667px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Para ganhar amplitude, quanto maior melhor. Por&eacute;m, &eacute; importante escolher com cuidado o local onde o espelho ser&aacute; colocado, para n&atilde;o refletir a luz e gerar inc&ocirc;modo. Uma forma bastante utilizada &eacute; coloc&aacute;-lo em uma parede inteira, refletindo o ambiente, transmitindo a sensa&ccedil;&atilde;o que o ambiente tem o dobro de tamanho. Por n&atilde;o ser um investimento t&atilde;o baixo, deve-se atentar para us&aacute;-lo corretamente. Al&eacute;m disso, us&aacute;-lo de forma equivocada pode provocar efeito inverso ao desejado.&nbsp;&nbsp;</p>\r\n\r\n<p>Na sala de jantar abaixo, o posicionamento correto duplica o tamanho da mesa. O uso anterior al&eacute;m de n&atilde;o aproveitar o reflexo no espelho para alongar a sala, deixa as cadeiras numa localiza&ccedil;&atilde;o perigosa, ficando muito pr&oacute;ximas do vidro.&nbsp;Caso n&atilde;o tenha condi&ccedil;&otilde;es de encostar a mesa no espelho, a op&ccedil;&atilde;o mais correta e segura &eacute; instalar o espelho apenas na parte superior da parede, acima da altura dos encostos.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://portalacreuna.com.br/admin/imagens/anna/2.jpg\" style=\"height:420px; width:667px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://portalacreuna.com.br/admin/imagens/anna/3.jpg\" style=\"height:420px; width:667px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://portalacreuna.com.br/admin/imagens/anna/4.jpg\" style=\"height:490px; width:667px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Dica</strong>: Os lugares estrat&eacute;gicos para instalar espelhos e proporcionar a sensa&ccedil;&atilde;o de amplitude s&atilde;o hall de entrada, sala de jantar, closets, lavabos, portas de arm&aacute;rios, prateleiras e paredes de fundo.</p>\r\n\r\n<p>Ao utilizar espelhos no quarto deve-se atentar para alguns fatores importantes, como quando o quarto &eacute; pequeno o ideal &eacute; sempre achar uma parede diagonal. N&atilde;o utiliz&aacute;-lo em frente &agrave; janela quando esta receber luz direta, para que o reflexo produzido n&atilde;o deixe o ambiente desconfort&aacute;vel. Tamb&eacute;m, n&atilde;o &eacute; bom utilizar espelhos em paredes externas, pois a umidade pode prejudic&aacute;-lo.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://portalacreuna.com.br/admin/imagens/anna/5.jpg\" style=\"height:390px; width:667px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://portalacreuna.com.br/admin/imagens/anna/6.jpg\" style=\"height:390px; width:667px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Para boas composi&ccedil;&otilde;es em ambientes com a presen&ccedil;a de muitos espelhos ou um espelho de grande propor&ccedil;&atilde;o o ideal &eacute; evitar texturas fortes e marcantes, assim como muitos objetos decorativos, como quadros, por exemplo, os quais ser&atilde;o refletidos pelos espelhos, deixando o ambiente carregado.</p>\r\n\r\n<p>E que tal utilizar m&oacute;veis espelhados? M&oacute;veis feitos de espelho ganham destaque, por isso, nada de exagerar no resto da decora&ccedil;&atilde;o.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://portalacreuna.com.br/admin/imagens/anna/7.jpg\" style=\"height:490px; width:667px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://portalacreuna.com.br/admin/imagens/anna/8.jpg\" style=\"width:667px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://portalacreuna.com.br/admin/imagens/anna/9.jpg\" style=\"height:390px; width:667px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Espelhos emoldurados, bisotados, lapidados. Sejam eles bronze, venezianos ou ovais. Vitorianos, proven&ccedil;ais, jateados. Estilo camarim ou apenas decorativo. Tem para os todos gostos, estilos e fun&ccedil;&otilde;es. O que n&atilde;o falta &eacute; op&ccedil;&atilde;o. O importante mesmo &eacute; abusar da criatividade. ;)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://portalacreuna.com.br/admin/imagens/anna/10.jpg\" style=\"height:390px; width:667px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://portalacreuna.com.br/admin/imagens/anna/11.jpg\" style=\"height:390px; width:667px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://portalacreuna.com.br/admin/imagens/anna/12.jpg\" style=\"height:450px; width:667px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Abaixo, segue algumas dicas sobre o uso de espelhos.</p>\r\n\r\n<p><strong>Dica 1:</strong> Qualquer ambiente aceita o uso de espelhos, mas cuidado com o uso exagerado. Isso pode fazer sua casa parecendo um labirinto.</p>\r\n\r\n<p><strong>Dica 2: </strong>Em ambientes pequenos, opte por utiliz&aacute;-lo fixado em uma das paredes. Caso possa investir em um modelo que preencha toda a parede, melhor, todavia, caso contr&aacute;rio, usar metade da parede j&aacute; transmite a sensa&ccedil;&atilde;o de amplitude. Use-o na horizontal para dar efeito de maior largura e vertical para efeito de maior altura.</p>\r\n\r\n<p><strong>Dica 3: </strong>A utiliza&ccedil;&atilde;o de um espelho no hall de entrada &eacute; uma &oacute;tima forma de passar a impress&atilde;o que sua casa &eacute; maior, visto que aquele espa&ccedil;o &eacute; o cart&atilde;o de visitas da resid&ecirc;ncia.</p>\r\n\r\n<p><strong>Dica 4: </strong>Caso queira ampliar o ambiente, &eacute; essencial que a posi&ccedil;&atilde;o do espelho em rela&ccedil;&atilde;o ao piso seja de 90&ordm;. J&aacute; para diminuir, reduza o &acirc;ngulo ou utilize espelhos com divis&otilde;es.</p>\r\n\r\n<p><strong>Dica 5: </strong>Em rela&ccedil;&atilde;o &agrave; altura do espelho, o ideal &eacute; que n&atilde;o seja muito alto tampouco muito baixo, mantendo-o com uma altura m&eacute;dia entre 1,40 m a 1,80m.</p>\r\n\r\n<p><strong>Dica 6: </strong>Al&eacute;m de fornecer a sensa&ccedil;&atilde;o de amplitude ao ambiente, o espelho pode auxiliar na ilumina&ccedil;&atilde;o. Use-o como revestimento das paredes laterais, assim aumentar&aacute; o reflexo da ilumina&ccedil;&atilde;o, tornando o local mais claro.</p>\r\n\r\n<p><strong>Dica 7:</strong> Evite usar um espelho na frente de outro, visto que provoca um sensa&ccedil;&atilde;o de infinito, podendo causar afli&ccedil;&atilde;o e desconforto.</p>\r\n\r\n<p><strong>Dica 8: </strong>Antes de escolher o tipo e a dimens&atilde;o do espelho, verifique o caminho que este passar&aacute; na hora do transporte para instal&aacute;-lo, como por exemplo, portas, corredores, escadas ou elevadores. Isto evitar&aacute; futuros transtornos, como ter que volta-lo para a vidra&ccedil;aria e cort&aacute;-lo em partes menores.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n','_28_01_16_11_02_22_noticia.jpg','2016-02-17 19:49:30',8,2,150,1),(5,'TendÃªncias de cores para 2016','EstÃ¡ pensando em trocar a cor da parede? Verdes e dourado sÃ£o as apostas para 2016.','<p>Verdes e ocre-dourado foram as coisas anunciadas por marcas de tintas como as &quot;cores do ano&quot; para 2016. Essas tend&ecirc;ncias s&atilde;o determinadas por meio de estudos realizados por especialistas nas &aacute;reas de design t&ecirc;xtil, moda, d&eacute;cor, arquitetura e comportamento.</p>\r\n\r\n<p>Conhe&ccedil;a as apostas para 2016 de tr&ecirc;s fabricantes de tintas:</p>\r\n\r\n<p><strong>&Aacute;gua-marinha (Suvinil):</strong> &Eacute; uma tonalidade que transmite tranquilidade, equil&iacute;brio e seguran&ccedil;a. Traz a ideia do verde iluminado e contemplativo do mar do Caribe. Varia&ccedil;&atilde;o de tonalidade da pedra com o mesmo nome, modelo da tropicalidade brasileira. Os matizes neutros e terrosos combinam bem com a nova cor.</p>\r\n\r\n<p><img alt=\"\" src=\"http://portalacreuna.com.br/admin/imagens/noticias/images/agua%20marinha%20(1).jpg\" style=\"height:200px; width:500px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://portalacreuna.com.br/admin/imagens/noticias/images/agua%20marinha%20(3).jpg\" style=\"float:left; height:375px; width:500px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Ouro Monarca (Coral):</strong> &Eacute; um ocre-dourado com um leve toque brilhante. Transi&ccedil;&atilde;o do tom laranja-acobreado. Pode ser associada com marrons, beges amarelos e matizes suaves de azul. Esta tonalidade cai bem tanto em ambientes internos quanto externos.</p>\r\n\r\n<p><img alt=\"\" src=\"http://portalacreuna.com.br/admin/imagens/noticias/images/1.jpeg\" style=\"height:333px; width:500px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://portalacreuna.com.br/admin/imagens/noticias/images/ouro4.jpeg\" style=\"height:450px; width:300px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Hortel&atilde; (Eucatex):</strong> De acordo com o fabricante, &eacute; uma tonalidade que preserva as propriedades tranquilas do azul e energ&eacute;ticas do amarelo, unindo as duas emo&ccedil;&otilde;es. &Eacute; um tom que traz bastante equil&iacute;brio, evoca a revitaliza&ccedil;&atilde;o e vitalidade. Harmoniza-se bem com tons neutros naturais da madeira, linho e algod&atilde;o, amarelo, f&uacute;csia e, at&eacute; mesmo, com o vinho. &Oacute;tima op&ccedil;&atilde;o para harmonizar resid&ecirc;ncias com esperan&ccedil;a de frescor e energia.</p>\r\n\r\n<p><img alt=\"\" src=\"http://portalacreuna.com.br/admin/imagens/noticias/images/Ambiente-1-Hortel%C3%A3-alta.jpg\" style=\"height:379px; width:500px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://portalacreuna.com.br/admin/imagens/noticias/images/Ambiente-5-Hortela%C3%8C%C6%92-sombra-alta.jpg\" style=\"height:350px; width:500px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://portalacreuna.com.br/admin/imagens/noticias/images/hortela.jpg\" style=\"height:566px; width:500px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Obs.:</strong> A tonalidade e brilho das cores podem sofrer altera&ccedil;&otilde;es devido diferentes configura&ccedil;&otilde;es do monitor utilizado e luminosidade do ambiente.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n','_01_02_16_04_23_46_noticias.jpg','2016-02-01 18:31:03',8,2,111,1),(6,'Financiamento a pequenos produtores com juros de atÃ© 2% ao ano','Por meio desta linha de crÃ©dito sÃ£o financiados projetos individuais de atÃ© R$ 150 mil e coletivos de atÃ© R$ 750 mil, com juros de 2% ao ano, atÃ© trÃªs anos de carÃªncia e atÃ© dez anos para pagar.','<p><span style=\"font-size:14px\"><span style=\"font-family:arial,helvetica,sans-serif\">O Mais Alimentos Produ&ccedil;&atilde;o Prim&aacute;ria &eacute; uma linha de cr&eacute;dito do Pronaf que financia investimentos em infraestrutura produtiva da propriedade familiar. Por meio desta linha de cr&eacute;dito s&atilde;o financiados projetos individuais de at&eacute; R$ 150 mil e coletivos de at&eacute; R$ 750 mil, com juros de 2% ao ano, at&eacute; tr&ecirc;s anos de car&ecirc;ncia e at&eacute; dez anos para pagar.</span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:arial,helvetica,sans-serif\">Para financiamento de estruturas de armazenagem o prazo pode chegar a 15 (quinze) anos, com car&ecirc;ncia de tr&ecirc;s anos. Cabe destacar que os financiamentos destinados &agrave;s atividades de suinocultura, avicultura e fruticultura podem chegar a R$ 300 mil.</span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:arial,helvetica,sans-serif\">Os cr&eacute;ditos est&atilde;o restritos ao financiamento de itens diretamente relacionados com a implanta&ccedil;&atilde;o, amplia&ccedil;&atilde;o ou moderniza&ccedil;&atilde;o da estrutura das atividades de produ&ccedil;&atilde;o, de armazenagem, de transporte ou de servi&ccedil;os agropecu&aacute;rios ou n&atilde;o agropecu&aacute;rios, no estabelecimento rural ou em &aacute;reas comunit&aacute;rias rurais pr&oacute;ximas, sendo pass&iacute;vel de financiamento, ainda, a aquisi&ccedil;&atilde;o de equipamentos e de programas de inform&aacute;tica voltados para melhoria da gest&atilde;o dos empreendimentos rurais, de acordo com projetos t&eacute;cnicos espec&iacute;ficos.</span></span></p>\r\n\r\n<p><img src=\"http://portalacreuna.com.br/admin/imagens/noticias/images/Mais-Alimentos-novo-logo_v3.jpg\" style=\"height:238px; width:100%\" /><span style=\"font-size:14px\"><span style=\"font-family:arial,helvetica,sans-serif\">Dentre os itens que podem ser financiados por este programa est&atilde;o ve&iacute;culos automotores para transporte de carga, tais como VW Saveiro, Fiat Strada e caminh&otilde;es. Tratores com at&eacute; 80 cv s&atilde;o financiados por essa modalidade tamb&eacute;m. As colheitadeiras por terem um valor acima do teto permitido por produtor, s&oacute; podem ser compradas por grupos de produtores ou cooperativas.</span></span></p>\r\n\r\n<p><br />\r\n<span style=\"font-size:14px\"><span style=\"font-family:arial,helvetica,sans-serif\"><strong>Benefici&aacute;rios</strong></span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:arial,helvetica,sans-serif\">Agricultores familiares enquadrados no Pronaf, exceto nos grupos A, A/C e B.</span></span></p>\r\n\r\n<p><br />\r\n<span style=\"font-size:14px\"><span style=\"font-family:arial,helvetica,sans-serif\"><strong>Encargos</strong><br />\r\nPara opera&ccedil;&otilde;es de at&eacute; R$ 10 mil:<br />\r\nSudene - 2,0% ao ano<br />\r\nDemais regi&otilde;es -&nbsp; 2,5% ao ano<br />\r\n<br />\r\nPara opera&ccedil;&otilde;es acima de R$ 10 mil e at&eacute; R$ 30 mil:<br />\r\nSudene - 3,5% ao ano<br />\r\nDemais Regi&otilde;es - 4,5% ao ano<br />\r\n<br />\r\nPara opera&ccedil;&otilde;es acima de R$ 30 mil e at&eacute; R$ 300 mil:<br />\r\nSudene - 4,5% ao ano (limitado a&nbsp; R$ 60 mil para Sudene)<br />\r\nDemais regi&otilde;es - 5,5% ao ano<br />\r\n<br />\r\n<strong>Prazo</strong><br />\r\nAt&eacute; 05 anos, inclu&iacute;da car&ecirc;ncia de at&eacute; 01 ano, para caminhonetes de carga<br />\r\nAt&eacute; 10 anos, com at&eacute; 3 anos de car&ecirc;ncia para demais itens financi&aacute;veis<br />\r\nAt&eacute; 02 anos, com at&eacute; 1 ano de car&ecirc;ncia, para cria, recria e engorda</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n','_01_02_16_06_03_04_noticias.png','2016-02-01 20:03:04',9,1,42,1),(7,'Estimativas de produÃ§Ã£o de soja em AcreÃºna','Segundo dados do IBGE, na safra 2013/2014, AcreÃºna teve uma Ã¡rea de plantio de 50.000 ha','<p>O IBGE mant&eacute;m um estudo sobre a previs&atilde;o de produ&ccedil;&atilde;o agr&iacute;cola do pa&iacute;s, classificando por munic&iacute;pios. Se alguns discordarem dos n&uacute;meros, &eacute; o mais pr&oacute;ximo da realidade que temos. Nesse estudo h&aacute; todas as culturas comerciais tais como algod&atilde;o, soja, milho ou trigo. Fizemos uma an&aacute;lise do principal item agr&iacute;cola produzido em Acre&uacute;na, a soja.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table border=\"0\" cellpadding=\"2\" cellspacing=\"0\" style=\"width:95%\">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan=\"16\"><strong>Produ&ccedil;&atilde;o agr&iacute;cola de soja</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Ano de Produ&ccedil;&atilde;o</strong></td>\r\n			<td><strong>2000</strong></td>\r\n			<td><strong>2004</strong></td>\r\n			<td><strong>2007</strong></td>\r\n			<td><strong>2010</strong></td>\r\n			<td><strong>2013</strong></td>\r\n			<td><strong>2014</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>&Aacute;rea em ha</td>\r\n			<td>10.000</td>\r\n			<td>30.000</td>\r\n			<td>22.000</td>\r\n			<td>31.000</td>\r\n			<td>40.000</td>\r\n			<td>50.000</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Quantidade em toneladas</td>\r\n			<td>26.000</td>\r\n			<td>52.200</td>\r\n			<td>61.600</td>\r\n			<td>85.500</td>\r\n			<td>112.800</td>\r\n			<td>135.000</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Produtividade em sc/ha</td>\r\n			<td>43,42</td>\r\n			<td>29,06</td>\r\n			<td>46,76</td>\r\n			<td>46,06</td>\r\n			<td>47,09</td>\r\n			<td>45,09</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Como pode ser observado, houve uma diminui&ccedil;&atilde;o da &aacute;rea plantada ap&oacute;s o ano de 2004, alcan&ccedil;ando o mesmo patamar somente no ano de 2010. Esse descr&eacute;scimo ocorreu principalmente por causa do algod&atilde;o, que chegou a ter uma &aacute;rea de 8.500 ha no munic&iacute;pio. Mas em todo caso vemos uma evolu&ccedil;&atilde;o impressionante no plantio da leguminosa, com um aumento impressionante entre os anos de 2000 e 2014, onde a &aacute;rea aumentou cinco vezes.</p>\r\n\r\n<p>A &aacute;rea aumentou muito, mas a produtividade ainda deixa a desejar segundo esses n&uacute;meros. Em catorze anos praticamente n&atilde;o houve evolu&ccedil;&atilde;o. Como a agricultura &eacute; um dos ramos mais din&acirc;micos do Brasil, vemos que nossa m&eacute;dia pode melhorar muito, trazendo muitos mais sacas de soja sem precisar invadir &aacute;reas de outras atividades econ&ocirc;micas. Mas &eacute; chato ver que a m&eacute;dia do ano agr&iacute;cola 2013/2014 (45,09 sc/ha) ser uma saca menor que quatro anos antes.</p>\r\n\r\n<p>Tendo a soja como principal item produzido em Acre&uacute;na, seria interessante analisar quanto essa leguminosa traz em dinheiro para o munic&iacute;pio. Tendo como base a estimativa de produ&ccedil;&atilde;o de 2014, 135.000 toneladas, temos 2.254.500 sacas, que &eacute; a modalidade comercializada. A cota&ccedil;&atilde;o m&eacute;dia de fevereiro/2016 est&aacute; em R$ 68,00.&nbsp; O &quot;PIB&quot; da soja vem desse produto: R$ 153.306.000,00. Seria um belo valor para uma mega-sena.</p>\r\n\r\n<p>Para saber o que a produ&ccedil;&atilde;o de soja em Acre&uacute;na representa no estado, vamos comparar os dados. Goi&aacute;s &eacute; o segundo maior produtor agr&iacute;cola do Centro-Oeste e quarto produtor nacional. A safra de gr&atilde;os alcan&ccedil;ou 18,9 milh&otilde;es de toneladas em 2014/2015, com incremento de 3,7% em rela&ccedil;&atilde;o ao per&iacute;odo 2013/2014, de 18,2 milh&otilde;es de toneladas. A &aacute;rea plantada goiana cresceu 7,2%, indo de 4,7 milh&otilde;es de hectares para 5,1 milh&otilde;es de hectares. Como os dados analisados s&atilde;o de 2013/2014 isso indica que Acre&uacute;na produziu 0,3% da soja estadual. S&oacute; pra registrar, Goi&aacute;s produz 9,7% da produ&ccedil;&atilde;o nacional.</p>\r\n','_01_02_16_07_44_03_noticia.jpeg','2016-02-01 21:48:41',9,1,31,1),(12,'jovem fera','e lindo','','_26_04_19_01_54_03_noticia.jpg','2019-04-26 16:54:03',4,1,2,1),(13,'Governo deseja acabar com exigÃªncia de simulador em autoescola','Com o fim da obrigatoriedade do simulador, o processo de habilitaÃ§Ã£o pode se tornar mais barato e, assim, mais acessÃ­vel para os futuros condutores. ','<p>O IBGE mant&eacute;m um estudo sobre a previs&atilde;o de produ&ccedil;&atilde;o agr&iacute;cola do pa&iacute;s, classificando por munic&iacute;pios. Se alguns discordarem dos n&uacute;meros, &eacute; o mais pr&oacute;ximo da realidade que temos. Nesse estudo h&aacute; todas as culturas comerciais tais como algod&atilde;o, soja, milho ou trigo. Fizemos uma an&aacute;lise do principal item agr&iacute;cola produzido em Acre&uacute;na, a soja.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table border=\"0\" cellpadding=\"2\" cellspacing=\"0\" style=\"width:95%\">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan=\"16\"><strong>Produ&ccedil;&atilde;o agr&iacute;cola de soja</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Ano de Produ&ccedil;&atilde;o</strong></td>\r\n			<td><strong>2000</strong></td>\r\n			<td><strong>2004</strong></td>\r\n			<td><strong>2007</strong></td>\r\n			<td><strong>2010</strong></td>\r\n			<td><strong>2013</strong></td>\r\n			<td><strong>2014</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>&Aacute;rea em ha<