/2016 est&aacute; em R$ 68,00.&nbsp; O &quot;PIB&quot; da soja vem desse produto: R$ 153.306.000,00. Seria um belo valor para uma mega-sena.</p>\r\n\r\n<p>Para saber o que a produ&ccedil;&atilde;o de soja em Acre&uacute;na representa no estado, vamos comparar os dados. Goi&aacute;s &eacute; o segundo maior produtor agr&iacute;cola do Centro-Oeste e quarto produtor nacional. A safra de gr&atilde;os alcan&ccedil;ou 18,9 milh&otilde;es de toneladas em 2014/2015, com incremento de 3,7% em rela&ccedil;&atilde;o ao per&iacute;odo 2013/2014, de 18,2 milh&otilde;es de toneladas. A &aacute;rea plantada goiana cresceu 7,2%, indo de 4,7 milh&otilde;es de hectares para 5,1 milh&otilde;es de hectares. Como os dados analisados s&atilde;o de 2013/2014 isso indica que Acre&uacute;na produziu 0,3% da soja estadual. S&oacute; pra registrar, Goi&aacute;s produz 9,7% da produ&ccedil;&atilde;o nacional.</p>\r\n','_26_04_19_04_04_42_noticia.jpg','2019-04-26 19:06:17',3,1,7,1),(15,'Governo planeja R$ 40 mi em propagandas a favor da reforma','PrevidÃªncia: para tentar ganhar batalha da comunicaÃ§Ã£o, governo lanÃ§arÃ¡ campanha publicitÃ¡ria','','_26_04_19_04_33_54_noticia.jpg','2019-04-26 19:33:54',3,1,0,1);
